import { Component, OnInit } from '@angular/core';
import {
  NavigationEnd,
  Event as NavigationEvent,
  Router,
  RouterModule
} from '@angular/router';
import { NgClass, NgIf } from '@angular/common';
import { HttpClientModule } from '@angular/common/http';
import { MatButtonModule } from '@angular/material/button';
import { MatIconModule } from '@angular/material/icon';
import { MatToolbarModule } from '@angular/material/toolbar';

@Component({
  standalone: true,
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
  imports: [
    RouterModule,
    HttpClientModule,
    MatIconModule,
    MatButtonModule,
    NgClass,
    NgIf,
    MatToolbarModule
  ]
})
export class AppComponent implements OnInit {
  routerUrl: string | undefined;
  orientation: boolean | undefined;
  private router: Router;
  constructor(router: Router) {
    this.router = router;
    // tracking skalars current page
    this.router.events.subscribe((event: NavigationEvent) => {
      if (event instanceof NavigationEnd) {
        this.routerUrl = event.url;
      }
    });
    // Determing device orientation
    window
      .matchMedia('(orientation: portrait)')
      .addEventListener('change', (e) => {
        // true is portrait
        this.orientation = e.matches;
        if (this.orientation) {
          // mobile, small tablets
        } else {
          // desktop, large tablets
        }
      });
  }

  ngOnInit(): void {
    console.log('app load');
  }

  // <!-- Terminal -->
  // <!-- <div class="terminal" [ngSwitch]="selection.value">
  //   <pre *ngSwitchDefault>ng generate component xyz</pre>
  //   <pre *ngSwitchCase="'material'">ng add @angular/material</pre>
  //   <pre *ngSwitchCase="'pwa'">ng add @angular/pwa</pre>
  //   <pre *ngSwitchCase="'dependency'">ng add _____</pre>
  //   <pre *ngSwitchCase="'test'">ng test</pre>
  //   <pre *ngSwitchCase="'build'">ng build</pre>
  // </div> -->
}
<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8">
  <title>Parent Navigator</title>
</head>

<body>
  <!-- navigation bar
  can add this all in other component file.. -->
<ng-template  *ngIf="(routerUrl !== ('/home' || '/sign-up' ))">
<mat-toolbar class="header">
  <!-- logo -->

  <!-- search bar extended-->
  <ng-template *ngIf="!orientation; else searchIcon">

    </ng-template>

<!-- search bar icon -->
    <ng-template #searchIcon>

    </ng-template>

  <nav>
  <!-- only for landscape -->
  <ng-template *ngIf="!orientation; else portrait">


<!-- profile -->
  <div class="navigation">
<button mat-icon-button routerLink="/profile">
  <mat-icon class="fa-solid fa-graduation-cap navigation-icon"
  [ngClass]="
  routerUrl === '/profile' ? 'navigation-icon-active' : 'navigation-icon'
"></mat-icon>
</button>
  </div>

</ng-template>

<!-- settings button -->

</nav>

</mat-toolbar>


<!-- only for portrait -->
<ng-template #portrait>
  <mat-toolbar class="footer">
  <nav>
<div class="navigation">
<button mat-icon-button routerLink="/profile">
  <mat-icon class="fa-solid fa-graduation-cap navigation-icon"
  [ngClass]="
  routerUrl === '/profile' ? 'navigation-icon-active' : 'navigation-icon'
"></mat-icon>
</button>
  </div>
  </nav>
</mat-toolbar>
</ng-template>
</ng-template>

  <!-- Render as component based on path of routes -->
  <!-- [orientation]="orientation" use ngrxlocal state management -->
  <router-outlet ></router-outlet>  
</body>
</html>
